const App = () => {
  return (
    <>
      {/*Başlığa click edildiğinde anasayfaya yönlendirir. */}
      <Link className="titleLink" to="/">
        <h1 className="title">Teknolojik Yemekler</h1>
      </Link>
      <Main />
    </>
  );
};
export default App;
